pragma solidity >=0.4.21 <0.7.0;
pragma experimental ABIEncoderV2;

contract UserManager {

    address private _admin;
    mapping(address => User) public _userlist;
    mapping(address => IssueCompany) public _issueCompanylist;
    mapping(address => Scenic) public _sceniclist;

    event Register(address indexed userAddr, uint indexed types, string name);
    
    uint ROLE_USER = 0;
    uint ROLE_ISSUER = 1;
    uint ROLE_SCENIC = 2;

    struct User {
        address addr;
        string name;
        uint256 balance;
        string[] mintTickets;
        string[] soldTickets;
        string[] usedTickets;
    }

    struct IssueCompany {
        address addr;
        string name;
        string[] scenicTickets;                      // root ticket
        mapping(string => string[]) issuedTickets;   // child ticket of root ticket
    }

    struct Scenic {
        address addr;
        string name;
        string issueCompany;
        uint state;
        string[] checkedTickets;
    }

    constructor() public {
        _admin = msg.sender;
    }

    function userRegister(string memory name, uint types) public {
        require(!_checkUserExist(types,msg.sender),"user already registed");
        if(types == ROLE_USER){
            _userlist[msg.sender].addr = msg.sender;
            _userlist[msg.sender].name = name;
        }
        if(types == ROLE_ISSUER){
            _issueCompanylist[msg.sender].addr = msg.sender;
            _issueCompanylist[msg.sender].name = name;
        }
        if (types == ROLE_SCENIC){
            _sceniclist[msg.sender].addr = msg.sender;
            _sceniclist[msg.sender].name = name;
        }
        emit Register(msg.sender,types,name);
    }
    
    function getUserInfo(address addr) public view returns (string name, string[] mintTickets, string[] usedTickets, string[] soldTickets, uint256 balance) {
        User storage _user = _userlist[addr];
        name = _user.name;
        mintTickets = _user.mintTickets;
        usedTickets = _user.usedTickets;
        soldTickets = _user.soldTickets;
        balance = _user.balance;
    } 
    
    function getIssueCoInfo(address addr) public view returns (string name, string[] scenicTickets) {
        name = _issueCompanylist[addr].name;
        scenicTickets = _issueCompanylist[addr].scenicTickets;
    } 
    
    function getIssuedTicketInfo(address addr, string sceincTicketName) public view returns (string[] issuedTickets) {
        issuedTickets = _issueCompanylist[addr].issuedTickets[sceincTicketName];
    } 

    function getScenicInfo(address addr) public view returns (string name, string[] checkedTickets) {
        name = _sceniclist[addr].name;
        checkedTickets = _sceniclist[addr].checkedTickets;
    }

    function drawBalance() public {
        _userlist[msg.sender].balance = 0;
    }
    
    function _issueTicket(address companyAddr, string ticketId) public {
        _issueCompanylist[companyAddr].scenicTickets.push(ticketId);
    }
    
    function _mintTicket(address userAddr, string ticketId, string[] cTicketIds) public {
        for( uint i=0; i < cTicketIds.length; i++){
            string memory cTicketId = cTicketIds[i];
            _userlist[userAddr].mintTickets.push(cTicketId);
