        }
    }
    
    function _acceptTicket(address fromUser, address toUser, string[] cTicketIds, uint transferPrice) public {
        User storage _fromUser = _userlist[fromUser];
        User storage _toUser = _userlist[toUser];
        for(uint j=0; j < cTicketIds.length; j++){
            _toUser.mintTickets.push(cTicketIds[j]);
            _fromUser.soldTickets.push(cTicketIds[j]);
        }
        _fromUser.balance += transferPrice*cTicketIds.length;
    }

    function _checkcTicket(string cTicketId, address userAddr) public {
        _sceniclist[tx.origin].checkedTickets.push(cTicketId);
        _userlist[userAddr].usedTickets.push(cTicketId);
    }

    function _checkUserExist(uint types,address addr) public view returns (bool) {
        address _addr;
        if(types == ROLE_USER){
            User memory _user = _userlist[addr];
            _addr = _user.addr;
        }
        if(types == ROLE_ISSUER){
            IssueCompany memory _issueCompany = _issueCompanylist[addr];
            _addr = _issueCompany.addr;

        }
        if(types == ROLE_SCENIC){
            Scenic memory _scenic = _sceniclist[addr];
            _addr = _scenic.addr;
        }
        if(_addr == address(0)){
            return false;
        }else {
            return true;
        }
    }
}
